  false,\n\t\"url\": null,\n\t\"notes\": \"Surficial material pertains to the unconsolidated
  earth materials which overlay bedrock and lie directly beneath the soil layer. The
  surficial materials layer consists principally of glacial deposits, such as till
  or alluvium. The surficial data also contains material texture, such as gravel,
  sand, silt and clay. The data is represented as regions, ie; region.surma (surficial
  materials), region.texture (textures), and in some quads, region.mum (map unit modifiers).
  An associated DBASE table (SURMA_DESC169.dbf) is available with surficial material
  code descriptions, and textures are listed in TEXTURES169.dbf. This data is the
  result of an update to the pre-existing GRANIT surficial materials data layer.\",\n\t\"license_title\":
